                                        <>
                                            <route.component {...props} />
                                        </>
                                    )}
                                />
                            )
                        )
                    })}
                </Routes> */}
                <h1> this is Appcontent</h1>
            </Suspense>
        </CContainer>
    )
};

export default AppContent;
